%[text] # Compare tongue and lip fluorescence (Figure 4)
%[text] Figure 4 shows the reliability of the data as we measured with multiple subjects, multiple levels of excitation lights, different positions on the dorsal tongue and lip
%%
%[text] ## Initialize code
ieInit;
wave = 500:700;
normWave = 520;
yscale = 'linear';
odLevels = 1:1:40;
fise_plotDefaults;

fontSizeTitle = 10; fontSizeWeight = 'normal'; 
fontSizeLegend = 12;
fontSizePlot = 12;

subjects = oeSubjects; 
[T,dataDir] = oeDatabaseCreate;
%%
%[text] ## Load the lip and tongue data (Figure 4a and 4b)
%[text] We load all of the subjects into a single large data set for tongue and another one for lip.  In this case we group the 405 and 415 nm excitation lights.  We put the tongue and lip data, normalized at nWave, on the same graph.
tongueData = [];
for ii=1:numel(subjects)
    files405 = ieTableGet(T,'subject',subjects{ii},'substrate','tongue','e wave',405);
    files415 = ieTableGet(T,'subject',subjects{ii},'substrate','tongue','e wave',415);
    tongueFiles = cat(1,files405,files415);
    tmp  = oeReadFiles(tongueFiles,'normalized wave',normWave,'wave',wave);
    tongueData = cat(2,tongueData,tmp);
end

lipData = [];
for ii=1:numel(subjects)
    files405 = ieTableGet(T,'subject',subjects{ii},'substrate','lip','e wave',405);
    files415 = ieTableGet(T,'subject',subjects{ii},'substrate','lip','e wave',415);
    lipFiles = cat(1,files405,files415);
    tmp  = oeReadFiles(lipFiles,'normalized wave',normWave,'wave',wave);   
    lipData = cat(2,lipData,tmp);
end 

ieFigure;  %[output:3e447ecd]
hA = plot(wave,lipData,'k--'); hold on; %[output:3e447ecd]
hB = plot(wave,tongueData,'Color',[1 1 1]*0.5); %[output:3e447ecd]
grid on;  %[output:3e447ecd]
xlabel('Wavelength (nm)'); ylabel('Normalized radiance (re: 520nm)'); %[output:3e447ecd]
lgn = legend([hA(1),hB(1)],{'lip','tongue'},'Location','northwest'); %[output:3e447ecd]
set(gca,'ylim',[0 3]) %[output:3e447ecd]
set(gca,'Fontsize',fontSizePlot); %[output:3e447ecd]
lgn.FontSize = fontSizeLegend; %[output:3e447ecd]
exportgraphics(gcf,'figure4A.png','Resolution',150); %[output:3e447ecd]
%%
%[text] ### 450 nm excitation light
tongueData450 = [];
for ii=1:numel(subjects)
    files450 = ieTableGet(T,'subject',subjects{ii},'substrate','tongue','e wave',450);
    tmp  = oeReadFiles(files450,'normalized wave',normWave,'wave',wave); 
    tongueData450 = cat(2,tongueData450,tmp);
end

lipData450 = [];
for ii=1:numel(subjects)
    files450 = ieTableGet(T,'subject',subjects{ii},'substrate','lip','e wave',450);
    tmp  = oeReadFiles(files450,'normalized wave',normWave,'wave',wave);       
    lipData450 = cat(2,lipData450,tmp);
end 

ieFigure;  %[output:084f6ca5]
hA = plot(wave,lipData450,'k--'); hold on; %[output:084f6ca5]
hB = plot(wave,tongueData450,'Color',[1 1 1]*0.5); %[output:084f6ca5]
grid on;  %[output:084f6ca5]
xlabel('Wavelength (nm)'); ylabel('Normalized radiance (re: 520nm)'); %[output:084f6ca5]
set(gca,'ylim',[0 1.5]) %[output:084f6ca5]
set(gca,'Fontsize',fontSizePlot); %[output:084f6ca5]
lgn = legend([hA(1),hB(1)],{'lip','tongue'},'Location','northwest'); %[output:084f6ca5]
lgn.FontSize = fontSizeLegend; %[output:084f6ca5]
exportgraphics(gcf,'figure4B.png','Resolution',150); %[output:084f6ca5]
%%
